const Cart = ({cart}) => {
    return (
        <div id="shopping-cart">
            {
                () => {
                    if (cart.length == 0) 
                        <p>El carrito está vacío</p>
                    else
                        <p>Imprimo items</p>
                }
            }
        </div>
    )
}

export default Cart;
